text:
Sobre Bolsonaro:
– Alvaro Dias: "bandido", "vagabundo", "está quase morto";
– Ciro: "nazista filho da puta", "fanático que nem o doido que enfiou a faca nele";
– Alckmin: "deu o primeiro tiro: no contribuinte, no pobre", pois "quer aumentar imposto".
Só distorção. Só desespero.

No ranking de vassalagem, Fachin acaba de passar Lewandowski.
1) Fachin rasga Lei da Ficha Limpa em prol da candidatura do presidiário Lula;
2) Lewandowski fatia votação do impeachment para manter direitos políticos de Dilma;
3) Toffoli solta Paulo Bernardo pulando 2 instâncias.
